import React from 'react';
import styled from 'styled-components';

const SpanWrapper = styled.span`
    background: #aacd6e;
    border-color: #aacd6e;
    
    :hover {
        background: #80c340;
        border-color: #80c340;
    }
`;

const SearchForm = () => {
    return (
        <SpanWrapper>
            
        </SpanWrapper>
    );
};

export default SearchForm;
